// import React, { useState, useEffect } from "react";
import style from "../NavBar/navbar.module.css";
import { Nav, NavDropdown, Navbar, Container } from "react-bootstrap";

import logo from "../../UI/Img/softechsolutions_logo.png";

const NavBar = () => {
  return (
    <Navbar
      collapseOnSelect
      expand="lg"
      bg="dark"
      variant="dark"
      className={style.nav}
    >
      <Container>
        <Navbar.Brand href="#home" className={style.brand}>
          <img src={logo} className={style.brand_logo} />
          Softech ERP
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav"  bg="dark" variant="dark">
          <Nav className={style.nav_link}  >
            <Nav.Link href="#features" className={style.nav_link_text}>
              Home
            </Nav.Link>
            <Nav.Link href="#pricing" className={style.nav_link_text}>About Us</Nav.Link>
            <Nav.Link href="#pricing" className={style.nav_link_text}>Partners</Nav.Link>
            <Nav.Link href="#pricing" className={style.nav_link_text}>Clients</Nav.Link>
            <Nav.Link href="#pricing" className={style.nav_link_text}>PortFolio</Nav.Link>
            <Nav.Link href="#pricing" className={style.nav_link_text}>Careers</Nav.Link>
            <Nav.Link href="#pricing" className={style.nav_link_text}>Contacts</Nav.Link>
            {/* <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
          <NavDropdown.Item href="#action/3.1">Services</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
          <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
          <NavDropdown.Divider />
          <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
        </NavDropdown> */}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavBar;
